//[奇遇]35[渡天劫]难度配置package cn.mxz;public class CopterDifficultyTemplet {	/** 	 * 配置id 	 */	private int id;	/** 	 * 上陣人數 	 */	private int number;	/** 	 * 難度（1低 2中 3 高） 	 */	private int difficulty;	/** 	 * 關卡名稱 	 */	private String LevelsOf;	/** 	 * 難度配置（品階，數量） 	 */	private String difficultyDeploy;	/** 	 * 星星倍數 	 */	private int star;	/** 	 * 同層難度係數 	 */	private float factor;	/**	 * 配置id	 */	void setId(int id) {		this.id = id;	}	/**	 * 配置id	 */	public int getId() {		return this.id;	}	/**	 * 上陣人數	 */	void setNumber(int number) {		this.number = number;	}	/**	 * 上陣人數	 */	public int getNumber() {		return this.number;	}	/**	 * 難度（1低 2中 3 高）	 */	void setDifficulty(int difficulty) {		this.difficulty = difficulty;	}	/**	 * 難度（1低 2中 3 高）	 */	public int getDifficulty() {		return this.difficulty;	}	/**	 * 關卡名稱	 */	void setLevelsOf(String LevelsOf) {		this.LevelsOf = LevelsOf;	}	/**	 * 關卡名稱	 */	public String getLevelsOf() {		return this.LevelsOf;	}	/**	 * 難度配置（品階，數量）	 */	void setDifficultyDeploy(String difficultyDeploy) {		this.difficultyDeploy = difficultyDeploy;	}	/**	 * 難度配置（品階，數量）	 */	public String getDifficultyDeploy() {		return this.difficultyDeploy;	}	/**	 * 星星倍數	 */	void setStar(int star) {		this.star = star;	}	/**	 * 星星倍數	 */	public int getStar() {		return this.star;	}	/**	 * 同層難度係數	 */	void setFactor(float factor) {		this.factor = factor;	}	/**	 * 同層難度係數	 */	public float getFactor() {		return this.factor;	}}